Allow us to share this easy and delicious recipe that will surely satisfy your cravings! 

What makes this recipe amazing is that it’s absolutely healthy and loaded with nutrients that may benefit your eye health and reduce oxidative stress and reduce blood pressure levels among other health functions. 

Ingredients: 

1 and 1/4 cups of chickpea flour (150 g)
1 and 1/3 cups of water (325 mL) 
1 and 1/4 cups of packed fresh spinach leaves
Optional: 1/4 teaspoon of fine sea salt (more or less to taste)

Directions: 

1) Put chickpea flour, water, spinach and salt in a blender and blend until the texture is completely smooth. 

2) Transfer batter to a glass measuring cup or pitcher. Cover and let it rest for at least 1 hour or for up to 48 hours. 

3) Pour about ⅓ cup batter into the pan. Cook for about 45 seconds, until its edges turn golden brown. Turn the tortilla over and cook for 15 to 30 seconds. 

